BEGIN TRANSACTION;

CREATE TABLE IF NOT EXISTS `tvfunction_mapping` (
	`id`	integer NOT NULL UNIQUE,
	`tvfunction`	character NOT NULL,
	`controlparams_json`	varcharacter,
	`covariate`	integer NOT NULL UNIQUE,
	`used`	boolean DEFAULT false,
	PRIMARY KEY(`id`),
	FOREIGN KEY(`covariate`) REFERENCES `covariate`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `tvf_table_mapping` (
	`tvfunction_mapping`	integer NOT NULL,
	`table_column`	integer NOT NULL,
	FOREIGN KEY(`table_column`) REFERENCES `table_column`(`id`) ON DELETE CASCADE,
	UNIQUE(`table_column`,`tvfunction_mapping`),
	FOREIGN KEY(`tvfunction_mapping`) REFERENCES `tvfunction_mapping`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `table_column` (
	`id`	integer NOT NULL UNIQUE,
	`model`	TEXT,
	`integer`	TEXT,
	`column_name`	varcharacter,
	`column_index`	integer,
	`status`	int,
	`data`	varcharacter,
	`map_to`	varcharacter,
	`used_for`	varcharacter,
	`formula`	varcharacter,
	`description`	varcharacter,
	`failure_message`	varcharacter,
	PRIMARY KEY(`id`),
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `tab_properties` (
	`id`	integer NOT NULL UNIQUE,
	`model`	integer,
	`tab`	character,
	`key`	character,
	`value`	character,
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `solverresult` (
	`id`	integer NOT NULL UNIQUE,
	`solver`	varcharacters,
	`parameterset`	integer,
	`dirty`	boolean,
	`date`	datetime,
	`jsonresult`	text,
	`timepoints`	varcharacter,
	`controlparams_json`	varcharacter,
	FOREIGN KEY(`parameterset`) REFERENCES `parameterset`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `session_properties` (
	`id`	integer NOT NULL UNIQUE,
	`model`	integer,
	`key`	character,
	`value`	character,
	PRIMARY KEY(`id`),
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `plot_properties` (
	`id`	integer NOT NULL UNIQUE,
	`model`	integer,
	`chartVar`	character,
	`key`	character,
	`value`	character,
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `parameterset` (
	`id`	integer NOT NULL UNIQUE,
	`name`	varchar,
	`model`	integer,
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `package` (
	`id`	integer NOT NULL UNIQUE,
	`package`	varchar NOT NULL UNIQUE,
	`expandable`	boolean,
	`editable`	boolean,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `model` (
	`id`	integer NOT NULL UNIQUE,
	`name`	varchar NOT NULL,
	`title`	varchar,
	`package`	integer NOT NULL,
	`equations`	varchar,
	`editable`	boolean,
	UNIQUE(`package`,`name`),
	PRIMARY KEY(`id`),
	FOREIGN KEY(`package`) REFERENCES `package`(`id`)
);
