CREATE TABLE IF NOT EXISTS `macro` (
	`id`	integer NOT NULL UNIQUE,
	`occurenceIndex`	integer,
	`name`	varchar,
	`formula`	varchar,
	`description`	varchar,
	`model`	integer,
	PRIMARY KEY(`id`),
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `estimation_result_fixed_row` (
	`estimation_result`	integer,
	`name`	varchar,
	`value`	double,
	`min`	double,
	`max`	double,
	`description`	varchar,
	FOREIGN KEY(`estimation_result`) REFERENCES `estimation_result`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `estimation_result_estimated_row` (
	`estimation_result`	integer,
	`name`	varchar,
	`estimatedValue`	double,
	`standardError`	double,
	`ciLowerBound`	double,
	`ciHighBound`	double,
	`pvalue`	double,
	`tstat`	double,
	`min`	double,
	`max`	double,
	`description`	varchar,
	FOREIGN KEY(`estimation_result`) REFERENCES `estimation_result`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `estimation_result` (
	`id`	integer NOT NULL UNIQUE,
	`parameterset`	integer,
	`solver`	varcharacters,
	`objective_function`	varcharacters,
	`confidence_interval`	varcharacters,
	`optimizer`	varcharacters,
	`nb_observations`	integer,
	`nb_estimates`	integer,
	`best_result`	double,
	`rss`	double,
	`aic`	double,
	`aicc`	double,
	`bic`	double dirty boolean,
	`date`	datetime,
	`json_intermediate_results`	result text,
	PRIMARY KEY(`id`),
	FOREIGN KEY(`parameterset`) REFERENCES `parameterset`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `estimated_param_value` (
	`id`	integer NOT NULL UNIQUE,
	`estimation_result`	integer,
	`model_symbol`	integer,
	`param_value`	double,
	`lower_bound`	double,
	`upper_bound`	double,
	`tstat`	double,
	`pvalue`	double,
	FOREIGN KEY(`model_symbol`) REFERENCES `estimable_symbol`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`),
	FOREIGN KEY(`estimation_result`) REFERENCES `estimation_result`(`id`) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS `estimable_symbol_value` (
	`id`	integer NOT NULL UNIQUE,
	`parameterset`	integer,
	`modelsymbol`	integer,
	`value`	double,
	`min`	double,
	`max`	double,
	`sliders`	boolean,
	`estimated`	boolean,
	FOREIGN KEY(`modelsymbol`) REFERENCES `estimable_symbol`(`id`) ON DELETE CASCADE,
	FOREIGN KEY(`parameterset`) REFERENCES `parameterset`(`id`) ON DELETE CASCADE,
	UNIQUE(`parameterset`, `modelsymbol`)
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `estimable_symbol` (
	`id`	integer NOT NULL UNIQUE,
	`type`	varchar,
	`occurenceIndex`	integer,
	`name`	varchar,
	`model`	integer,
	`description`	varchar,
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `covariate` (
	`id`	integer NOT NULL UNIQUE,
	`occurenceIndex`	integer,
	`name`	varchar,
	`timeexpression`	varchar,
	`description`	varchar,
	`model`	integer,
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
CREATE TABLE IF NOT EXISTS `chartable_properties` (
	`id`	integer NOT NULL UNIQUE,
	`model`	integer,
	`symbol`	character,
	`log`	boolean,
	`visible`	boolean,
	`style`	character,
	FOREIGN KEY(`model`) REFERENCES `model`(`id`) ON DELETE CASCADE,
	PRIMARY KEY(`id`)
);
COMMIT;
